import github from '../img/github.svg';
import email from '../img/email.svg';
import linkedin from '../img/linkedin.svg';
import { Link } from 'react-router-dom';


function Footer() {
    return (
        <footer className="footer">
            <div className="round">
                <div className="link-container">
                    <Link to="https://github.com/jdearden4/"><img src={github}/></Link>
                    <Link to="mailto:jdearden44@gmail.com"><img src={email}/></Link>
                    <Link to="https://www.linkedin.com/in/julia-dearden/"><img src={linkedin}/></Link>
                </div>
            </div>
        </footer>
    )
}
export default Footer;
